import React from 'react';
import { Carousel } from 'react-responsive-carousel';
import 'react-responsive-carousel/lib/styles/carousel.min.css';

const styles = {
  app: {
    textAlign: 'center',
    backgroundColor: '#f4f4f4',
    minHeight: '100vh',
    display: 'flex',
    flexDirection: 'column',
  },
  header: {
    backgroundColor: '#333',
    color: 'white',
    padding: '20px',
  },
  nav: {
    backgroundColor: '#444',
    color: 'white',
    padding: '20px',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    height: '40px',
  },
  logo: {
    marginLeft: '20px',
    fontSize: '1.5rem',
    fontWeight: 'bold',
  },
  navUl: {
    listStyleType: 'none',
    padding: 0,
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  },
  navLi: {
    margin: '0 15px',
    cursor: 'pointer',
  },
  loginButton: {
    backgroundColor: '#555',
    color: 'white',
    padding: '10px 15px',
    borderRadius: '5px',
    cursor: 'pointer',
    marginRight: '20px',
  },
  sliderContainer: {
    width: '100%',
    maxWidth: '100%',
    margin: '20px 0',
  },
  carouselContainer: {
    boxSizing: 'none',
  },
  carouselImage: {
    width: '100%',
    height: '100%',
    objectFit: 'cover',
  },
  missionSection: {
    marginTop: '30px',
    display: 'flex',
    justifyContent: 'space-around',
    flexWrap: 'wrap',
  },
  missionCard: {
    width: '30%',
    border: '1px solid #ddd',
    borderRadius: '8px',
    overflow: 'hidden',
    margin: '10px',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
  },
  missionImage: {
    width: '100%',
    height: '200px',
    objectFit: 'cover',
  },
  missionCardContent: {
    padding: '15px',
  },
  missionTitle: {
    fontSize: '1.2rem',
    fontWeight: 'bold',
    marginBottom: '10px',
  },
  missionDescription: {
    fontSize: '1rem',
    color: '#555',
  },
  clubsSection: {
    marginTop: '30px',
    display: 'flex',
    justifyContent: 'space-around',
    flexWrap: 'wrap',
  },
  clubCard: {
    width: '30%',
    border: '1px solid #ddd',
    borderRadius: '8px',
    overflow: 'hidden',
    margin: '10px',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
  },
  clubImage: {
    width: '100%',
    height: '200px',
    objectFit: 'cover',
  },
  clubCardContent: {
    padding: '15px',
  },
  clubTitle: {
    fontSize: '1.2rem',
    fontWeight: 'bold',
    marginBottom: '10px',
  },
  clubDescription: {
    fontSize: '1rem',
    color: '#555',
  },
  joinButton: {
